To check if an array has content in Shopify Liquid, you can use the `count` filter. The `count` filter returns the number of elements in an array. If the count is greater than 0, then the array has content. 

Here's an example code snippet:

```
{% if my_array.count > 0 %}
    <p>My array has content!</p>
{% else %}
    <p>My array is empty.</p>
{% endif %}
```

In this example, `my_array` is an array that we want to check for content. If `count` is greater than 0, then the array has content and we can output a message to the page. If `count` is 0, then the array is empty and we can output a different message.
